import React from 'react';
import Radio from '@material-ui/core/Radio';
import RadioGroup from '@material-ui/core/RadioGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import FormControl from '@material-ui/core/FormControl';
import FormLabel from '@material-ui/core/FormLabel';
import homewarranty from "../assets/images/homewarranty.png";


const RealStateOrder = () => {
    // const [value, setValue] = React.useState('female');

    // const handleChange = (event) => {
    //     setValue(event.target.value);
    // };
    return (
        <>
            <div className="home_page">
                <div className="top_img">
                    <img src={homewarranty} alt="homewarranty" />
                </div>
                <div className="realstate">
                    <h1>Real Estate Orders</h1>
                </div>
                <div className="container">
                    <div className="contentbox">
                        <h4>I want to get a home warranty for a property in:</h4>
                        <FormControl>
                            <RadioGroup>
                                <FormControlLabel value="utah" control={<Radio />} label="UTAH" />
                                <FormControlLabel value="idaho" control={<Radio />} label="IDAHO" />
                                <FormControlLabel value="nevada" control={<Radio />} label="NEVADA" />
                                <FormControlLabel value="arizona"control={<Radio />} label="ARIZONA" />
                                <FormControlLabel value="texas"  label="TEXAS" />
                            </RadioGroup>
                        </FormControl>
                    </div>
                </div>
            </div>
        </>
    )
};
export default RealStateOrder;
